  false,\n\t\"url\": null,\n\t\"notes\": \"The regions onThis map represent areas
  with similar hydrogeologic characteristics thought to represent similar potentials
  for contamination of groundwater and/or water wells. The map was created from an
  unprecedented compilation and interpretation of primary geologic and soil data;
  compilation of interim Arc/Info coverages of bedrock aquifers/aquitards, thickness
  of Quaternary deposits, alluvial aquifers, sinkholes (centers of 400 meter radius
  circles), and agricultural drainage wells (centers of 400 meter radius circles);
  overlay techniques; and evaluation of groundwater contamination and well contamination
  data. This coverage is published in 1991 as the 1:500,000 scale, color map: Groundwater
  Vulnerability Regions of Iowa.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
